// * a declarative solution

const removeDuplicates = (string) => {
  const stack = [];

  for (const char of string) {
    const noDuplicate = char !== stack[stack.length - 1];

    if (noDuplicate) stack.push(char);
    else stack.pop();
  }

  return stack.join('');
};

